import React from "react";
import Navbar from "./Navbar";
import { motion } from "motion/react"

function Aboutus2() {
    return (
        <div className="aboutus2-container">
            <Navbar />
            <motion.div
                className="box"
                initial={{ opacity: 0, scale: 0.9, y: 50 }}
                animate={{ opacity: 1, scale: 1, y: 0 }}
                transition={{ duration: 0.8, ease: "easeOut" }}
            >
                <div className="aboutus2-SecImg">
                    <img src="/aboutus.jpeg" alt="img1" />
                </div>
                <div className="aboutus2-desc">
                    <p>About Us</p>
                    <p>Explore a wide range of top-quality motor and vehicle components designed to ensure unmatched performance and durability.</p>
                </div>
            </motion.div>
            <div className="our-story">
                <h2>OUR STORY</h2>
                <p>Quality Services for All Your Motor Repair Needs</p>
                <div className="our-story-img">
                    <img src="/storyimg.webp" alt="" />
                    <div className="company-history">
                        <p>Mysore Motors is a company specializing in the supply and distribution of motor and vehicle parts. It serves as a key player in the automotive industry, offering a wide range of high-quality components essential for the maintenance and repair of various vehicles. The company is known for its commitment to reliability, providing both standard and specialized parts to meet the needs of customers, from individual vehicle owners to businesses in the automotive service sector. Mysore Motors ensures its customers have access to durable, high-performance products, making it a trusted name in the industry.</p>
                    </div>
                </div>
            </div>
        </div>
    );
}
export default Aboutus2;
